import React from "react";

function ColorBtns() {
  return (
    <div>
      <button
        id="red"
        type="checkbox"
        className="rounded-full  bg-red-500 ml-5 p-4"
      >
        {" "}
        <input type="checkbox" className="w-5 h-5" />
      </button>
      <button
        id="purple"
        className="rounded-full bg-purple-500 ml-5 p-4"
      ></button>
      <button
        id="yellow"
        className="rounded-full bg-yellow-500 ml-5 p-4"
      ></button>
      <button id="blue" className="rounded-full bg-sky-500 ml-5 p-4"></button>
      <button id="gray" className="rounded-full bg-gray-400 ml-5 p-4"></button>
    </div>
  );
}

export default ColorBtns;
